    <style>
        nav {
            display: flex;
            background-color: black;
            height: 9em;
            border: none solid black;
            border-radius: 4em;
            position: sticky;
            width: 93em;
            opacity: .86;
        }

        ul {
            display: flex;
            margin-left: 3em;
        }

        li {
            color: white;
            list-style: none;
            margin-left: 0em;
            margin-right: 3em;
            font-size: 1.3em;
            margin-top: 2em;

        }

        li :hover {
            color: black;
            text-decoration: underline;
            border: none solid black;
            border-radius: 0.2em;
        }

        a.nav {
            text-decoration: none;
            width: 16em;
            height: 5em;
            color: black;
            -webkit-text-stroke: 1px #fff;
        }

        input {
            height: 3em;
            width: 23em;
            border: 2px solid white;
            border-radius: 2em;
            margin-top: 3em;
            font-style: bold;
            font-family: Verdana, Geneva, Tahoma, sans-serif;
            text-align: center;
            margin-left: 7em;
            background: none;
            outline: none;
            color: white;
        }

        ::-webkit-input-placeholder {
            -webkit-text-stroke: 1px #fff;
        }

        img#search {
            height: 2em;
            width: 2em;
            margin-top: 3em;
            margin-left: 0.8em;
        }

        #logo {
            height: 7em;
            width: 7em;
            margin-left: -1em;
            margin-top: 4em;
            border: 4px solid white;
            border-radius: 7em;
            padding: 0.3em;
        }

        h1 {
            margin-left: -0.4em;
            font-family: 'Abril Fatface', cursive;
            font-weight: bolder;
            text-decoration: underline;
        }

        div#main {
            border: 10px solid rgb(228, 164, 108);
            height: 22em;
            width: 86em;
            border-radius: 1em;
            margin-top: 2.2em;
            margin-left: 3em;
            text-align: center;
            box-shadow: peachpuff 0.8em 0.8em 1em;
        }

        #content {
            font-family: 'Fredoka', sans-serif;
            font-size: 1.3em;
            font-weight: bold;
        }

        #thank {
            margin-top: 2em;
            font-size: 4em;
            font-family: 'Abril Fatface', cursive;
            border: 6px solid rgb(228, 164, 108);
            height: 1.3em;
            width: 10em;
            border-radius: 1em;
            box-shadow: peachpuff 0.8em 0.8em 1em;
            margin-left: 5.6em;
            margin-top: 0em;
        }

        button {
            background-color: red;
            outline: none;
            border: 0px solid none;
            border-radius: 1px;
            height: 3em;
            width: 10em;
            margin-top: 2em;
            color: white;
            font-size: 0.5em;
        }

        #hover :hover {
            cursor: pointer;
        }

        body {
            background-color: peachpuff;
        }
    </style>
